import React from 'react'
import styled from 'styled-components'

import Title from '../src/components/atoms/title'
const Main = styled.main`
  background: #282A36;
  height: 100vh;
  width: 100%;
  margin: 0;
  padding: 0;
  display: flex;
`

export default () => {


  return (
    <Main>
      <Title fingerPrint="asd"/>
    </Main>
  )
}
